import React from 'react'
import 'semantic-ui/dist/semantic.min.css';
import './M/Managermain2.css'
import Managerheader1 from '../Managerpg1/Managerheader1'
import ManagerNav from "../Managerpg1/ManagerNav";
import ManagerFooter from "../Managerpg1/ManagerFooter";
import {BrowserRouter,Redirect} from "react-router-dom";
//import Managermain3 from "../Managerpg3/Managermain3"
import axios from 'axios'

class Empmain1 extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            id:24,
            month:''

        }
    }


   setRedirect = async  (e) => {
        // event.preventDefault();
       // 
       //alert(this.state)
       await  this.setState({
            month:e
        })
        console.log('month',this.state)
     //   alert(this.state.month)
        const response = axios({
            method: 'patch',
            url: 'http://192.168.1.245:8095/updatemonthvalue',
            data: this.state
        })
        // .then(response=>{
        //      console.log(JSON.stringify(response.data))

        // }


        this.setState({
            redirect: true
        })


    }     



    render() {
        {
            if (this.state.redirect) {
                return <Redirect to="/month/static-form"/>;

            }
        }

        return (
            <div className="manbg">
                <Managerheader1/>
                <ManagerNav/>

                <br/>
                <br/>
                <br/>
                <h1 style={{color:"black"}}  className="ui" >Your Employee is 'NAME' </h1>
                <br/>
                <br/>




<br/>
<BrowserRouter>

    <nav>




          <div className="calender">
                <button onClick={(e)=>this.setRedirect('jan')} style={{margin:"30px"}} className="buttonGrey">JAN</button>
                <button onClick={(e)=>this.setRedirect('feb')} style={{margin:"30px"}} className="buttonGrey">FEB</button>
                <button onClick={(e)=>this.setRedirect('mar')} style={{margin:"30px"}} className="buttonGrey">MAR</button>
                <button onClick={(e)=>this.setRedirect('apr')} style={{margin:"30px"}} className="buttonGrey">APR</button>
                <button onClick={(e)=>this.setRedirect('may')} style={{margin:"30px"}} className="buttonGrey">MAY</button>
                <button onClick={(e)=>this.setRedirect('june')} style={{margin:"30px"}} className="buttonGrey">JUN</button> <br/>
                <button onClick={(e)=>this.setRedirect('july')} style={{margin:"30px"}} className="buttonGrey">JUL</button>
              <button onClick={(e)=>this.setRedirect('aug')} style={{margin:"30px"}} className="buttonGreen" >AUG  </button>
                <button onClick={(e)=>this.setRedirect('sep')} style={{margin:"30px"}} className="buttonRed">SEPT</button>
                <button onClick={(e)=>this.setRedirect('oct')} style={{margin:"30px"}} className="buttonRed">OCT</button>
                <button onClick={(e)=>this.setRedirect('nov')} style={{margin:"30px"}} className="buttonRed">NOV</button>
                <button onClick={(e)=>this.setRedirect('december')} style={{margin:"30px"}} className="buttonRed">DEC</button>

                <br/>
                <br/>




            </div>
    </nav>
</BrowserRouter>
                <br/>
                <br/>
                <br/>
<ManagerFooter/>
        </div>
        )
    }
}

